import React from 'react';
import './styles/Header.css';
import logo from '../assets/logo.png'; // Замените на путь к вашему логотипу

function Header() {
  return (
    <header className="header">
      <div className="logo">
        <img src={logo} alt="Logo" />
      </div>
      <nav className="nav">
        <a href="#">Новинки</a>
        <a href="#">Чоловіки</a>
        <a href="#">Жінки</a>
        <a href="#">Діти</a>
      </nav>
      <div className="auth-buttons">
        <button className="login-button">Вхід</button>
        <button className="register-button">Реєстрація</button>
      </div>
    </header>
  );
}

export default Header;
